import React from 'react';
import trenchCoat1 from "../Images/trenchCoat1.jpg";
import trenchCoat2 from "../Images/trenchCoat2.jpg";
import trenchCoat3 from "../Images/trenchCoat3.jpg";
import trenchCoat4 from "../Images/trenchCoat4.jpg";
import "../css/CardList.css";
import Card from './Card';

const CardList = () => {
    return (
        <div class = "new-product">
                 <div class="row">
                <Card image = {trenchCoat1}></Card>
                <Card image = {trenchCoat2}></Card>
                <Card image = {trenchCoat3}></Card>
                <Card image = {trenchCoat4}></Card>
              </div>
        </div>
    );
}

export default CardList;
